import React from "react";
import "./AboutUs.css";

function AboutUs() {
  return (
    <div>
      <div className="about-us-section1">
        <h2>About Us</h2>
        <p>
          We are a team of developers dedicated to creating innovative and
          user-friendly software.
        </p>
      </div>
      <div className="about-us-section2">
        <h3>Our Mission</h3>
        <p>
          To empower people through technology and provide solutions to everyday
          problems.
        </p>
      </div>
    </div>
  );
}

export default AboutUs;
